import React, { Component } from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.css";
import Home from "./components/Home";
import Footer from "./components/Footer";
import GridContainer from "./components/GridContainer";
import ShowPage from "./components/ShowPage";
// import Rahma from './components/rahma'
// import ImageUpload from './components/ImageUpload';
import Blog from "./components/blog";
import Share from "./components/newShare";
import { BrowserRouter as Router, Route } from "react-router-dom";
import About from "./components/AboutUs";
import axios from "axios";
//================================IMPORTS=====================================//

class App extends Component {
  constructor() {
    super();
    this.state = {
      data: []
    };
  }
  //==========================MOUNTING DATA FROM DB=============================//
  componentDidMount() {
    axios
      .get("http://localhost:20000/showcase")
      .then(({ data }) => {
        this.setState({ data });
        console.log(this.state.data);
      })
      .catch(error => {
        console.log(error);
      });
  }
  //==========================ROUTING AND COMPONENTS=============================//
  render() {
    return (
      <div className="App">
        <nav class="navbar navbar-expand-lg juicy-peach-gradient color-block-5 mb-3 mx-auto rounded-circle z-depth-1-half">
          <a class="navbar-brand" href="#">
            Ta
          </a>
        </nav>
        <Router>
          <Route exact path="/" component={Home} />
          <Route
            exact
            path="/Showcase"
            render={props => (
              <GridContainer {...props} data={this.state.data} />
            )}
          />
          <Route exact path="/place/:id" component={ShowPage} />
          {/* <Route exact path="/share" component={Rahma}/> */}
          {/* <Route exact path="/share" component={ImageUpload}/> */}
          <Route exact path="/share" component={Share} />
          <Route exact path="/new" component={Blog} />

          <Route exact path="/about" component={About} />
        </Router>
        <Footer />
      </div>
    );
  }
}

export default App;
